/*
 React-native-camera mock

 Required on Android to prevent the camera permission popup from appearing.

 Inspired by https://stackoverflow.com/questions/58716420/mocking-rncamera-with-detox-does-not-work-non-mock-impl-is-called
 */
import React from 'react';

const timeout = (ms) => new Promise((resolve) => setTimeout(resolve, ms));

class RNCamera extends React.Component {
  static Constants = {
    Aspect: {},
    BarCodeType: {},
    Type: { back: 'back', front: 'front' },
    CaptureMode: {},
    CaptureTarget: {},
    CaptureQuality: {},
    Orientation: {},
    FlashMode: {},
    TorchMode: {},
    AutoFocus: { on: {} },
    WhiteBalance: { auto: {} },
  };

  takePictureAsync = async () => {
    await timeout(1000);
    return {
      uri:
        'data:image/jpeg;base64,',
    };
  };

  render() {
    return null;
  }
}

export { RNCamera };
